        stack = []
        i = 0
        while i < n:
            temp = ''
            while i < n and s[i].isnumeric():
                temp += s[i]
                i += 1
            exp += temp + '_'
            while i < n and len(stack) != 0 and (priority[stack[--1]] >= priority[s[i]]):
                exp += stack.pop()
            if i < n:
                stack.append(s[i])
            i += 1
        while len(stack) != 0:
            exp += stack.pop()
        return exp

    def calculation(s: str) -> int:
        n = len(s)
        stack = []
        i = 0
        while i < n:
            temp = ''
            while i < n and s[i].isnumeric():
                temp += s[i]
                i += 1
            if i < n and len(stack) > 1 and isoperator(s[i]):
                a = stack.pop()
                b = stack.pop()
                if s[i] == '+':
                    res = a + b
                if s[i] == '-':
                    res = b - a
                if s[i] == '*':
                    res = a * b
                if s[i] == '/':
                    res = b // a
                if s[i] == '^':
                    res = a ** b
                stack.append(res)
            else:
                stack.append(int(temp))
            i += 1
        return stack[-1]
    exp = infix_postfix(s)
    res = calculation(exp)
    return res
